import React, { useEffect, useRef } from 'react';
import { useHistory } from 'react-router-dom';
import { createWidget } from 'tradingview';

function Tokens() {
  const history = useHistory();
  const widgetContainerRef = useRef(null);
  const widgetInstanceRef = useRef(null);

  useEffect(() => {
    // Create the widget instance
    widgetInstanceRef.current = createWidget('symbol-ticker-tape', widgetContainerRef.current, {
      symbols: [
        { description: '', proName: 'BINANCE:BTCUSDT' },
        { description: '', proName: 'BINANCE:ETHUSDT' },
        { description: '', proName: 'CRYPTOCAP:USDT' },
        { description: '', proName: 'CRYPTOCAP:USDC' },
        { description: '', proName: 'CRYPTOCAP:ADA' },
        { description: '', proName: 'CRYPTOCAP:MATIC' },
        { description: '', proName: 'CRYPTOCAP:SOL' },
        { description: '', proName: 'CRYPTOCAP:BNB' },
        { description: '', proName: 'BINANCE:ARBUSDT' },
        { description: '', proName: 'CRYPTOCAP:AAVE' },
        { description: '', proName: 'CRYPTOCAP:UNI' },
      ],
      showSymbolLogo: true,
      colorTheme: 'light',
      isTransparent: true,
      displayMode: 'adaptive',
      locale: 'en',
    });

    // Load the widget
    widgetInstanceRef.current && widgetInstanceRef.current.mount();

    // Clean up when the component unmounts
    return () => {
      widgetInstanceRef.current && widgetInstanceRef.current.remove();
    };
  }, []);

  const handleGoBack = () => {
    history.goBack(); // Go back to the previous page
  };

  return (
    <div>
      <div ref={widgetContainerRef} className="tradingview-widget-container"></div>
      <div>
        <button onClick={handleGoBack}>Go Back</button>
      </div>
    </div>
  );
}

export default Tokens;
